package com.demo.freemark.wordtemplateexport.service.impl;

import com.demo.freemark.wordtemplateexport.entity.Person;
import com.demo.freemark.wordtemplateexport.service.IExportService;
import com.demo.freemark.wordtemplateexport.util.ExportUtils;
import com.google.common.collect.Lists;
import com.google.common.collect.Maps;
import org.springframework.stereotype.Service;

import javax.servlet.http.HttpServletResponse;
import java.util.List;
import java.util.Map;

@Service
public class ExportServiceImpl implements IExportService {
    @Override
    public void exportWord(HttpServletResponse response) throws Exception{
        String s1 = "";
        //String s2 = "";
        String s2 = "";
        Map<String, Object> map = Maps.newHashMap();
        List<Person> personList = Lists.newArrayList();
        personList.add(Person.builder().name("张永名").age(27).image(s1).build());
        personList.add(Person.builder().name("呵呵哒").age(29).image(s2).build());

        map.put("personList", personList);

        ExportUtils.template2Word("template.ftl", map, "导出word带图片", response);
    }
}
